B.Lr=new A.h1("p1","Photo Shark","PartsCoder","An offline-first mobile application designed to empower demolition teams working in remote environments. The app allows users to capture, organize, and manage over 10,000 part photos directly from the field. By integrating barcode scanning and persistent local storage, it ensures that operational data is never lost, regardless of network connectivity.",B.Hn,B.Gf,"Flutter Developer","Offline Data Synchronization: Designing a robust sync engine that queues thousands of images and metadata records locally (using Drift) and reliably uploads them via background processes once connectivity is restored.\n\nLarge-Scale Asset Management: optimizing list rendering and memory usage to handle 10k+ high-resolution images within the mobile app without compromising performance or causing UI jank.\n\nConcurrency: Managing a custom queue-based background upload system to prevent network bottlenecks and ensure data integrity during partial syncs.","https://play.google.com/store/apps/details?id=com.codebeex.photoshark","#","CodeBeeX SRL","assets/Images/photo_shark/feature_graphic.png")
